import './App.css';
import './scss/master.scss';
import logo from './images/new_logo.png';
import Home from './html/home.js';
import Personal from './html/personal.js';
import Professional from './html/professional.js';
import Aboutme from './html/aboutme.js';

function App() {
  return (
    <div className="App">
      <body>
    <div class="menu">
      <div class="menubtn">
        <span data-toggle-target="togglemenu" class="toggle-btn">MENU</span>
      </div>
      <ul class="togglemenu">
        <li><a href="#home" class="btn1">HOME</a></li>
        <li><a href="#software" class="btn2">SOFTWARE</a></li>
        <li><a href="#hardware" class="btn3">HARDWARE</a></li>
        <li><a href="#aboutme" class="btn4">ABOUT ME</a></li>
      </ul>
    </div>
    <Home />
    <div class="background background1"></div>
    <Professional />
    <div class="background background2"></div>
    <Personal />
    <div class="background background3"></div>
    <Aboutme />
  </body>
    </div>
  );
}

export default App;
